import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { ChatComponent } from './chat/chat.component';
import { NavbarComponent } from './navbar/navbar.component';
import { PostComponent } from './post/post.component';
import { AddpostComponent } from './addpost/addpost.component';
import { HttpClientModule } from '@angular/common/http';
import { FormsModule } from '@angular/forms';
import { CloudinaryModule, CloudinaryConfiguration } from '@cloudinary/angular';
import { Cloudinary as CloudinaryCore } from '@cloudinary/core';

const cloudinary = {
  Cloudinary: CloudinaryCore
};

export const cloudinaryConfiguration: CloudinaryConfiguration = {
  cloud: {
    cloudName: 'your-cloud-name' // Replace 'your-cloud-name' with your actual Cloudinary cloud name
  }
};

@NgModule({
  declarations: [
    AppComponent,
    ChatComponent,
    NavbarComponent,
    PostComponent,
    AddpostComponent,
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule,
    FormsModule,
    CloudinaryModule.forRoot(cloudinary, cloudinaryConfiguration)
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
